import React from 'react';
import RatingBar from '../components/RatingBar';
import '../styles/main.css';

export default function Form() {
  return (
    <React.Fragment>
      <div className="form-background">
        <div className="form-container">
          <RatingBar name={'quality'} />
        </div>
      </div>
    </React.Fragment>
  );
}
